$(document).ready(function(){$("input, textarea").each(function(){$(this).on("focus",function(){$(this).parent(".Form-group").addClass("is-active")}),$(this).on("blur",function(){0==$(this).val().length&&$(this).parent(".Form-group").removeClass("is-active")}),""!=$(this).val()&&$(this).parent(".Form-group").addClass("is-active")}),$("label").click(function(){var t=$(this).attr("for");$("#"+t).focus()})}),$(document).ready(function(){$(".carousel").flickity({wrapAround:!0,autoPlay:3e3,pauseAutoPlayOnHover:!1,dragThreshold:10,selectedAttraction:.1,friction:.7,arrowShape:{x0:10,x1:60,y1:50,x2:63,y2:50,x3:13},pageDots:!0,prevNextButtons:!1})});